data.text:
@YumiYonni Shion in a fit of rage unleashed a monsterous amount of bad luck sending the men shooting back with extreme force, even a few cracks were heard, ouch.

“Stay... away from her... Yumi...? Are you alright...?”

Shion took Yumi’s hands to look her in the eyes. https://t.co/wJv9lbZseb
